    return(
        <Modal>
            <div class="motivation">
                <div className="motivation__hero">
                   <img src="https://ikebana-app-content.s3-sa-east-1.amazonaws.com/static/japan-garden.jpg" alt="Hero" />
                </div>
            </div>
        </Modal>
    );
}
